import React from 'react';
import './App.css';
import { Navigation } from "./components/Navigation";
import { SummonerInput } from './components/SummonerInput';

import './style.css'



export default function App() {
  return (
    <div>
    <Navigation /> 
      <div className="px-3 py-3 pt-md-5 pb-md-4 mx-auto">
      <SummonerInput />
      </div>
    </div>
  );
}
